import UIKit

protocol LikesPresentationProtocol {
    func callMatchListAPI()
    func getMatchResponse(response : MatchUser)
}

class LikesPresenter: LikesPresentationProtocol {
    weak var viewController: LikesProtocol?
    var interactor: LikesInteractorProtocol?
    
    func callMatchListAPI() {
        self.interactor?.callMatchListAPI()
    }
    func getMatchResponse(response : MatchUser){
        self.viewController?.getMatchResponse(response : response)
    }
}
